-- ----------------------------
-- Table structure for cer_entry
-- ----------------------------
DROP TABLE IF EXISTS `cer_entry`;
CREATE TABLE `cer_entry` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `business_date` datetime DEFAULT NULL COMMENT '业务日期',
  `sequence_number` int(11) DEFAULT NULL COMMENT '顺序号，所有凭证信息顺序号，结算后清零',
  `document_word` int(11) DEFAULT NULL COMMENT '凭证字，关联字典表，一般为，记，收，付，转',
  `document_number` int(11) DEFAULT NULL COMMENT '跟凭证字关联，所有数目相加等于顺序号',
  `documents_number` int(11) DEFAULT NULL COMMENT '单据数，所录凭证有多少张单据',
  `prepared_by` varchar(65) DEFAULT NULL COMMENT '制单人，与登入者主键',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `settlement_state` char(1) DEFAULT '1' COMMENT '结转损益状态,1为未结算，0为已结算',
  `lump_sum` decimal(12,2) DEFAULT NULL COMMENT '总金额',
  `period` int(2) DEFAULT NULL COMMENT '会计期间',
  `settlement_mouth_state` char(1) DEFAULT '1' COMMENT '结算状态，月份 0已结账',
  `remarks` text COMMENT '备注',
  `state` char(1) DEFAULT '1' COMMENT '状态1显示，0删除 ‘用于限制操作权限’',
  `settlement_years_state` char(1) DEFAULT '1' COMMENT '年结算状态，1未结帐，0已结帐',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=285 DEFAULT CHARSET=utf8 COMMENT='凭证录入表';

-- ----------------------------
-- Records of cer_entry
-- ----------------------------

