-- Table structure for cer_entry_schedule
-- ----------------------------
DROP TABLE IF EXISTS `cer_entry_schedule`;
CREATE TABLE `cer_entry_schedule` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `summary` text COMMENT '凭证摘要',
  `expense_account` varchar(255) DEFAULT NULL COMMENT '会计科目',
  `debit_amount` decimal(12,2) DEFAULT NULL COMMENT '借方金额',
  `credit_amount` decimal(12,2) DEFAULT NULL COMMENT '贷方金额',
  `foreign_key` int(65) DEFAULT NULL COMMENT '凭证主表键',
  `rownum` int(11) DEFAULT '1' COMMENT '分组排序字段',
  `original_currency` decimal(12,2) DEFAULT NULL COMMENT '原币金额',
  `contacts_dnit` varchar(255) DEFAULT NULL COMMENT '往来单位核算',
  `department` varchar(255) DEFAULT NULL COMMENT '部门核算',
  `staff` varchar(255) DEFAULT NULL COMMENT '职员核算',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1707 DEFAULT CHARSET=utf8 COMMENT='凭证录入附表，用于储存摘要，会计科目，借贷金额';

