-- Table structure for cer_expense_account
-- ----------------------------
DROP TABLE IF EXISTS `cer_expense_account`;
CREATE TABLE `cer_expense_account` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `account_code` varchar(60) DEFAULT NULL COMMENT '科目代码',
  `subiect_name` varchar(60) DEFAULT NULL COMMENT '科目名称',
  `superior_code` varchar(60) DEFAULT NULL COMMENT '上级代码',
  `account_category` varchar(222) DEFAULT NULL COMMENT '科目类别名称',
  `balance_direction` varchar(20) DEFAULT NULL COMMENT '余额方向',
  `other_accounting` int(11) DEFAULT '1' COMMENT '辅助核算 1 单一 2多核',
  `contacts_dnit` varchar(200) DEFAULT '0' COMMENT '往来单位核算',
  `department` varchar(200) DEFAULT '0' COMMENT '部门核算',
  `staff` varchar(200) DEFAULT '0' COMMENT '职员核算',
  `STATUS` varchar(10) DEFAULT '0' COMMENT '本条数据状态 0 显示 1删除',
  `cost_type` varchar(255) DEFAULT '0' COMMENT '数据类型0贸易，1非贸易',
  PRIMARY KEY (`id`)
